import React from 'react';
import { useUser } from '../context/UserContext';

function HomePage() {
  const { user } = useUser();

  return (
    <div className="container mt-5 text-center">
      {user ? (
        <h1>Welcome, {user.username}!</h1>
      ) : (
        <h1>Welcome to Trip DVisor!</h1>
      )}
    </div>
  );
}

export default HomePage;
